DROP TABLE IF EXISTS x2_timezones,x2_timezone_points;
/*&*/
CREATE TABLE x2_timezones (
	id						INT(11)			NOT NULL,
	name					VARCHAR(40)		NOT NULL,
	PRIMARY KEY (`id`)
) COLLATE = utf8_general_ci;
/*&*/
CREATE TABLE x2_timezone_points (
	lat						FLOAT			NOT NULL,
	lon						FLOAT			NOT NULL,
	tz_id					INT				NOT NULL,
	INDEX (lat),
	INDEX (lon)
) COLLATE = utf8_general_ci;
/*&*/
